import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Header2 = () => {
  const navigate = useNavigate();

  const onclick = (e) => {
    e.preventDefault();

    navigate("/login");
  };
  return (
    <div className="navbar bg-black shadow-lg " id="navbar">
      

      <Link to={'/'}>
        <button type="submit" className="navbar-end ">
        
          className="btn bg-rose-700 shadow-sm px-16 text-white shadow-rose-900 hover:bg-black">
          Back to Home
        
      </button>
      </Link>
    </div>
  );
};

export default Header2;
